import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import Navbar from './App';
import Gallery from './Gallery';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Navbar />
    <Gallery />
  </React.StrictMode>
);
